script: |
  super -f text -I q7306.spq | sort > q7306.out

inputs:
  - name: q7306.spq
    data: |
      SELECT DISTINCT col1 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE - col2 - 69 < + ( + - col1 ) + + - 21 - 41 + - - col2 * + col0;
  - name: tab1

outputs:
  - name: q7306.out
    data: |
      14
      47
      5
